import React, {useState, Fragment} from "react";

function RegisterAccount(props){

    return( 
        <Fragment>
            <input />
            <input />
            <button>Add</button>
            <h2>title : {props.title} </h2>
            <h2>value : {props.value} </h2>
        </Fragment>
    );
}

export default RegisterAccount;
